import React from 'react';

class NavbarButton extends React.Component
{
	render()
	{
		const style = {
			border: '1px solid rgba(255, 255, 255, 0.3)',
			padding: '5px 10px'
		}

		return (
			<div>
				<p style={style}> Button </p>	
			</div>
		);
	}
}

export default NavbarButton;
